import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { title: "Car Insurance1", amount: 294.67, date: new Date(2021, 2, 28) },
    { title: "Car Insurance2", amount: 294.67, date: new Date(2021, 2, 28) },
    { title: "Car Insurance3", amount: 294.67, date: new Date(2021, 2, 28) },
    { title: "Car Insurance4", amount: 294.67, date: new Date(2021, 2, 28) },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      {expenses.map((expense) => {
        <ExpenseItem
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        />;
      })}
       {/* <ExpenseItem />
       <ExpenseItem />
       <ExpenseItem />
       <ExpenseItem /> */}
    </div>
  );
}

export default App;
